VALUES ('20201777', 'Mélange bio boulgour quinoa légumes', 'boulgourl (blé), quinoal, lentilles coraill, carottel, Ireaul oignonl persill. llngrédient issu de l\'agriculture ologique. Peut contenir des traces de soja, de fruits à coque et de graines de sésame. Conseils de préparation (pour 4 personnes) : verser ce mélange avec deux fois son volume d\'eau ou de bouillon de légumes dans une casserole. Porter à ébullition, baisser le feu et laisser mijoter environ 15 minutes, Retirer du feu puis laisser gonfler environ 5 minutes, couvercle ouvert. Le mélange est prêt ext petit être servi en accompagnement ou comme plat principal. A conserver à l\'abri de la chaleur et de l\'humidité. A consommer de préférence avant le voir la date', 'https://static.openfoodfacts.org/images/products/20201777/front_fr.17.400.jpg', '2.2', '0.3', '59', '4.1', '13', '13', '0.08', '0.031496062992126', '', '1');

