VALUES ('20204280', 'Couscous bio', 'Hergestellt für Norma von: AntersdorferMühle GmbH & Co. Vertriebs KG 0-84359 Simbach/lnn WIEC)CRVERSCHLIESSBAR @Couscous (semoule de blé dur précuite) bio Ingrédient : semoule de blé dur issue de ligriculture biologique. Peut contenir des traces de soja, de graines de sésame et de fruits à coque. Le couscous est fabriqué à partir de semoule de blé dur. Celèbre plat d\'Afrique du Nord, il peut éaalement être consommé froid en salades de fruits de mer ou de légumes frais. Chaud, il est délicieux dans les desserts, les soupes et les ragoûts ou bien en accompagnement. Conseils de prepration (pour 2 personnes, en accompagnement) : verser 00 g (environ 2 tasses) de couscous dans I équivalent de 3 tasses environ d\'eau bouillante éventuellement salee. Couvrir et laiqser gonfler environ 10 minutes, en remuant de temps en temps.', 'https://static.openfoodfacts.org/images/products/20204280/front_fr.4.400.jpg', '1.7', '0.3', '68.7', '0.8', '6.2', '11.7', '0.02', '0.0078740157480315', '', '1');

